[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX taxon: <http://purl.uniprot.org/taxonomy/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT (COUNT(DISTINCT ?protein) AS ?count)
WHERE {
  ?protein a up:Protein ;
           up:organism taxon:9606 ;
           up:reviewed true ;
           up:classifiedWith ?keyword .
  ?keyword rdfs:label ?label .
  FILTER(CONTAINS(LCASE(?label), "kinase"))
}
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX taxon: <http://purl.uniprot.org/taxonomy/>

SELECT (COUNT(DISTINCT ?protein) AS ?kinaseCount)
WHERE {
  ?protein a up:Protein ;
           up:organism taxon:9606 ;
           up:reviewed true ;
           up:annotation ?annotation .
  ?annotation a up:Function_Annotation .
  ?annotation rdfs:comment ?comment .
  FILTER(CONTAINS(LCASE(STR(?comment)), "kinase"))
}
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX taxon: <http://purl.uniprot.org/taxonomy/>
PREFIX keywords: <http://purl.uniprot.org/keywords/>

SELECT (COUNT(DISTINCT ?protein) AS ?kinaseCount)
WHERE {
  ?protein a up:Protein ;
           up:organism taxon:9606 ;
           up:reviewed true ;
           up:classifiedWith keywords:Kinase .
}
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX taxon: <http://purl.uniprot.org/taxonomy/>

SELECT (COUNT(DISTINCT ?protein) AS ?kinaseCount)
WHERE {
  ?protein a up:Protein ;
           up:organism taxon:9606 ;
           up:reviewed true ;
           up:classifiedWith ?keyword .
  ?keyword a up:Keyword .
  ?keyword up:prefLabel ?label .
  FILTER(CONTAINS(LCASE(?label), "kinase"))
}
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX taxon: <http://purl.uniprot.org/taxonomy/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT (COUNT(DISTINCT ?protein) AS ?kinaseCount)
WHERE {
  ?protein a up:Protein ;
           up:organism taxon:9606 ;
           up:reviewed true ;
           up:classifiedWith ?keyword .
  ?keyword rdfs:label ?label .
  FILTER(REGEX(?label, "kinase", "i"))
}
"}}]

