PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>

SELECT DISTINCT ?molecule ?moleculeName ?maxPhase ?drugType
WHERE {
  ?molecule a chembl:SmallMolecule ;
            chembl:hasMolecule/chembl:molecularWeight ?mw ;
            chembl:pref_name ?moleculeName ;
            chembl:hasIndication ?indication .
