}
LIMIT 50"}}, {"name": "mcp__pubmed__search_articles", "input": {"query": "type 2 diabetes therapeutics drug classes review", "max_results": 5, "date_from": "2022"}}, {"name": "mcp__pubmed__get_article_metadata", "input": {"pmids": ["41572751", "41552827", "41542765"]}}]
